import React from 'react';
import './MapOfParos.scss';
import mapOfParos from './../../images/drawing.png';

interface IMapOfParosProps {

}

const MapOfParos : React.FC<IMapOfParosProps> = props => {
    return (
        <div className={`map-of-paros`}>
            <img src={mapOfParos} />
        </div>
    );
}

export default MapOfParos;
